import React from "react";


const Titles = () => (
  <div>
    <h1 className = "title-container__title"> National Park Kiosk </h1>
    <h3 className = "title-container__subtitle"> Everything you want to know, consolidated for ease of access! </h3>
    <h5 className = "title-container__subtitle"> To start searching, check out the list of park codes <a href = "https://nps-vsp.warnercnr.colostate.edu/startpage.php"> <u><b>Click Here!</b></u></a> </h5>
  </div>
);

export default Titles;
